import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import Betting from './components/Betting';
import History from './components/History';
import AdminDashboard from './components/AdminDashboard';
import BasketballMatches from './components/BasketballMatches';
import SportsMatches from './components/SportsMatches';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Navbar />
          <main className="container" style={{ paddingTop: '20px', paddingBottom: '40px' }}>
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
              <Route path="/betting" element={<ProtectedRoute><Betting /></ProtectedRoute>} />
              <Route path="/basketball" element={<ProtectedRoute><BasketballMatches /></ProtectedRoute>} />
              <Route path="/sports" element={<ProtectedRoute><SportsMatches /></ProtectedRoute>} />
              <Route path="/history" element={<ProtectedRoute><History /></ProtectedRoute>} />
              <Route path="/admin" element={<AdminRoute><AdminDashboard /></AdminRoute>} />
            </Routes>
          </main>
        </div>
      </Router>
    </AuthProvider>
  );
}

function HomePage() {
  const { user } = useAuth();
  
  if (user) {
    return <Navigate to="/dashboard" replace />;
  }

  return (
    <div className="text-center">
      <div className="card" style={{ maxWidth: '600px', margin: '0 auto' }}>
        <h1 style={{ fontSize: '48px', marginBottom: '20px', background: 'linear-gradient(45deg, #667eea, #764ba2)', WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent' }}>
          üèàüèÄ American Sports Betting
        </h1>
        <p style={{ fontSize: '20px', color: '#6c757d', marginBottom: '30px' }}>
          Bet on NBA basketball and NFL football with real odds and live matches
        </p>
        <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', flexWrap: 'wrap' }}>
          <a href="/register" className="btn btn-primary">Get Started</a>
          <a href="/login" className="btn btn-secondary">Login</a>
        </div>
      </div>
      
      <div className="grid grid-3" style={{ marginTop: '60px' }}>
        <div className="card text-center">
          <h3 style={{ color: '#667eea', marginBottom: '16px' }}>üèàüèÄ Live Sports Odds</h3>
          <p>Real-time NBA and NFL odds from The Odds API with Moneyline, Spread, and Total bets.</p>
        </div>
        <div className="card text-center">
          <h3 style={{ color: '#667eea', marginBottom: '16px' }}>üí∞ $100 Welcome Bonus</h3>
          <p>Start with $100 in credits to explore our sports betting platform risk-free.</p>
        </div>
        <div className="card text-center">
          <h3 style={{ color: '#667eea', marginBottom: '16px' }}>üìä Track Your Bets</h3>
          <p>Monitor your sports betting history and track your performance over time.</p>
        </div>
      </div>
    </div>
  );
}

function ProtectedRoute({ children }: { children: React.ReactNode }) {
  const { user, loading } = useAuth();
  
  if (loading) {
    return <div className="text-center">Loading...</div>;
  }
  
  if (!user) {
    return <Navigate to="/login" replace />;
  }
  
  return <>{children}</>;
}

function AdminRoute({ children }: { children: React.ReactNode }) {
  const { user, loading } = useAuth();
  
  if (loading) {
    return <div className="text-center">Loading...</div>;
  }
  
  if (!user || user.role !== 'admin') {
    return <Navigate to="/dashboard" replace />;
  }
  
  return <>{children}</>;
}

export default App;
